import { Document, Page, pdfjs } from '@react-pdf/renderer';
// Настройка воркера (важно!)
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com{pdfjs.version}/pdf.worker.js`;

function LectionPage({ file }) {
  return (
    <Document file={file}>
      <Page pageNumber={1} />
    </Document>
  );
}
export default LectionPage
